e Stockade is a high-security prison complex, hidden beneath the canal district of Stormwind city. Presided over by Warden Thelwater, the Stockade is home to petty crooks, political insurgents, murderers and a score of the most dangerous criminals in the land. Recently, a prisoner-led revolt has resulted in a state of pandemonium within the stockade - where the guards have been driven out and the convicts roam free. Warden Thelwater has managed to escape the holding area and is currently enlisting brave thrill-seekers to venture into the prison and kill the uprising's mastermind - the cunning felon, Bazil Thredd.",lvl=15,mapID=225,savedInstanceID=34,["zone-text-areaID"]=717,g={n(-1000031,{q(389,{coords={{49,30.2,1453}},lvl=16,qgs={1646},r=2,rwp=40001,sourceQuests={373}}),q(377,{coords={{72,46.8,1431}},lvl=24,qgs={270},r=2,rwp=40001,g={qo(1,{providers={{"i",3628}}}),s(118343,2906,{b=1,f=6,filterForRWP=7,rwp=40001}),s(117668,2033,{b=1,f=5,rwp=40001})}}),q(387,{coords={{41.2,58,1453}},lvl=22,qgs={1719},r=2,rwp=40001}),q(388,{coords={{73.6,47.7,1453}},lvl=22,qgs={1721},r=2,rwp=40001,g={qo(1,{crs={1663,1706,1707,1708,1711,1715,1716,1720},providers={{"i",2909}}})}}),q(378,{coords={{49.8,18.2,1437}},lvl=25,qgs={1074},r=2,rwp=40001,sourceQuests={303},g={qo(1,{providers={{"i",3640}}}),s(117222,1264,{b=1,f=24,rwp=40001}),s(118864,3562,{b=1,f=5,rwp=40001})}}),q(391,{coords={{41.2,58,1453}},lvl=16,qgs={1719},r=2,rwp=40001,sourceQuests={389},g={qo(1,{providers={{"i",2926}}})}}),q(386,{coords={{26,43,1433}},lvl=22,qgs={859},r=2,rwp=40001,g={qo(1,{providers={{"i",3630}}}),s(117251,1317,{b=1,f=28,rwp=40001}),s(118727,3400,{b=1,f=25,rwp=40001})}})}),n(-1000044,{i(1076,{f=52,lvl=20,rwp=40001})}),n(1720,{description="This is a rare that was not always present.",rwp=40001,g={s(118369,2942,{b=1,f=34,lvl=21,rwp=40001}),s(118567,3228,{b=1,f=6,filterForRWP=7,lvl=21,rwp=40001}),s(118368,2941,{b=1,f=20,lvl=21,rwp=40001})}}),n(1666,{rwp=40001,g={i(3640,{rwp=40001}),s(117862,2280,{b=1,f=28,lvl