e, and the leader of the gronn, Gruul, impaled the wyrms he fought on the stone spires of the mountains.\n\nToday Gruul the Dragonkiller is worshipped as a deity by the ogres of Blade's Edge Mountains. His powerful sons ravage both the spires of their home and the plains of Nagrand. Gruul's unparalleled strength and experience in battle would pose a serious threat if he ever chose to attack Horde or Alliance forces in Outland.",lvl=68,mapID=330,savedInstanceID=565,u=17,["zone-text-areaID"]=3618,g={n(18831,{u=17,g={i(29763,{b=1,c={2,4,7},lvl=70,u=17}),i(29764,{b=1,c={1,5,11},lvl=70,u=17}),i(29762,{b=1,c={3,8,9},lvl=70,u=17}),s(139146,28800,{b=1,f=24,lvl=70,u=17}),s(139142,28796,{b=1,f=5,lvl=70,u=17}),s(139147,28801,{b=1,f=6,lvl=70,u=17}),s(139143,28797,{b=1,f=3,lvl=70,u=17}),s(139141,28795,{b=1,f=7,lvl=70,u=17}),s(139145,28799,{b=1,f=4,lvl=70,u=17})}}),n(19044,{u=17,g={ach(692,{OnUpdate=handlers.ANY_SOURCE_QUEST,sourceQuests={10901},u=17}),i(29766,{b=1,c={2,4,7},lvl=70,u=17}),i(29767,{b=1,c={1,5,11},lvl=70,u=17}),i(29765,{b=1,c={3,8,9},lvl=70,u=17}),s(139140,28794,{b=1,f=22,lvl=70,u=17}),s(139148,28802,{b=1,f=25,lvl=70,u=17}),s(139171,28825,{b=1,f=8,lvl=70,u=17}),i(28826,{b=1,f=36,lvl=70,rwp=50004,u=17}),s(139150,28804,{b=1,f=4,lvl=70,u=17}),s(139149,28803,{b=1,f=5,lvl=70,u=17}),i(28822,{b=1,f=51,lvl=70,u=17}),s(139170,28824,{b=1,f=7,lvl=70,u=17}),s(139173,28827,{b=1,f=6,lvl=70,u=17}),s(139174,28828,{b=1,f=5,lvl=70,u=17}),s(139156,28810,{b=1,f=6,lvl=70,u=17}),i(28830,{b=1,f=53,lvl=70,u=17}),i(28823,{b=1,f=53,lvl=70,u=17}),i(31750,{u=17})}})}}),inst(747,{coords={{47.51,52.08,1944}},isLockoutShared=1,isRaid=1,lore="After the Legion came to Outland, Magtheridon controlled all but small pockets of Outland. Even so, he was taken largely by surprise when Illidan and his allies conquered the Black Temple. Many believed that Magtheridon had been slain in the attack, but, when Illidan discovered that Magtheridon's blood had a transformative, corrupting effect on orcs, the beaten pit lord was dragged to Hellfire Citadel.\n\nBound by chains both physical and magical, Magtheridon survives, at the brink of death. Each day, Illidan's minions drain his tainted blood, pooling it for a purpose as malevolent as Magtheridon himself: the creation of a new army of barbaric fel orcs.",lvl=68,mapID=331,savedInstanceID=544,u=17,["zone-text-areaID"]=3836,g={n(-1000031,{u=17,g={q(11002,{providers={{"i",32385}},r=2,u=17,g={i(28792,{b=1,f=52,u=17}),i(28793,{b=1,f=52,u=17}),i(28790,{b=1,f=52,u=17}),i(28791,{b=1,f=52,u=17})}}),q(11003,{providers={{"i",32386}},r=1,u=17,g={i(28792,{b=1,f=52,u=17}),i(28793,{b=1,f=52,u=17}),i(28790,{b=1,f=52,u=17}),i(28791,{b=1,f=52,u=17})}}),q(10888,{coords={{54.2,44.4,1955}},qgs={18481},rwp=30002,sourceQuests={10884,10885,10886},u=17,g={qo(1,{providers={{"n",17257}},u=17}),i(31746,{b=1,f=52,u=17}),i(31704,{b=1,u=17}),ach(432,{OnUpdate=handlers.ANY_SOURCE_QUEST,rwp=30002,sourceQuests={10888},u=17}),title(36,{rwp=30002,u=17})}})}}),n(17257,{u=17,g={ach(693,{OnUpdate=handlers.ANY_SOURCE_QUEST,sourceQuests={10888,11002,11003,11116},u=17}),i(32385,{b=1,lvl=70,r=2,u=17}),i(32386,{b=1,lvl=70,r=1,u=17}),i(29754,{b=1,c={2,4,7},lvl=70,u=17}),i(29753,{b=1,c={1,5,11},lvl=70,u=17}),i(29755,{b=1,c={3,8,9},lvl=70,u=17}),i(34845,{b=1,f=113,u=17}),s(139128,28782,{b=1,f=28,lvl=70,u=17}),s(139120,28774,{b=1,f=29,lvl=70,u=17}),s(139129,28783,{b=1,f=27,lvl=70,u=17}),s(139804,29458,{b=1,f=8,lvl=70,u=17}),s(139127,28781,{b=1,f=1,lvl=70,u=17}),s(139121,28775,{b=1,f=7,lvl=70,u=17}),s(139123,28777,{b=1,f=3,lvl=70,u=17}),s(139122,28776,{b=1,f=5,lvl=70,u=17}),s(139126,28780,{b=1,f=4,lvl=70,u=17}),s(139125,28779,{b=1,f=7,lvl=70,u=17}),s(139124,28778,{b=1,f=6,lvl=70,u=17}),i(28789,{b=1,f=53,lvl=70,u=17}),i(34846,{awp=20400,description="The epic gems may not be available until Black Temple is released, however, some users have reported getting one out of this bag already.",u=17,g={i(32227,{u=17}),i(32228,{u=17}),i(32229,{u=17}),i(32231,{u=17}),i(32230,{u=1