tiful groves, and leaf-covered pathways that dot the city's landscape are testaments to the night elves' reverence for nature. One of Darnassus's most notable structures is the stunning Temple of the Moon, the center of worship for High Priestess Tyrande Whisperwind and her Sisters of Elune. The prime reason why the city's population is so low is that it is isolated: Teldrassil is a small island away from the main mass of Azeroth, and the only way to gain access from another continent is to fly or sail to Rut'theran Village, a small settlement at the base of Teldrassil, and from there step into the glowing portal to the city proper. Darnassus is home to night elves of all vocations and remains a symbol of the night elves' rich culture and glorious history.",g={n(-1000020,{faction(69,{icon=_.asset("Achievement_Character_Nightelf_Female"),OnTooltip=function(t, tooltipInfo)	local reputation = t.reputation;	if reputation < 42000 then	_.Modules.FactionData.AddReputationTooltipInfo(tooltipInfo, reputation, "Runecloth Turn Ins",	75,	42000);	end	end,r=2})}),n(-1000031,{q(7799,{coords={{64,23,1457}},cost={{"i",4338,60}},lvl=40,qgs={14725},r=2,rwp=40003}),q(7800,{coords={{64,23,1457}},cost={{"i",14047,60}},lvl=50,qgs={14725},r=2,rwp=40003}),q(10354,{coords={{64,23,1457}},cost={{"i",4306,60}},lvl=26,qgs={14725},r=2,rwp=40003}),q(10352,{coords={{64,23,1457}},cost={{"i",2592,60}},lvl=12,qgs={14725},r=2,rwp=40003}),q(5647,{altQuests={5641,5645},c={5},coords={{39.2,81,1457}},lvl=20,maps={1455},qgs={11401},races={3},u=2}),q(7801,{coords={{64,23,1457}},cost={{"i",14047,20}},lvl=50,maxReputation={69,42000},qgs={14725},r=2,repeatable=1,rwp=40003,sourceQuests={7800}}),q(3763,{coords={{67.4,15.7,1457}},isBreadcrumb=1,lvl=47,nextQuests={3764},qgs={6735},r=2,rwp=40003}),q(3790,{coords={{18.1,51.5,1455}},isBreadcrumb=1,lvl=47,nextQuests={3764},qgs={5111},r=2,rwp=40003}),q(3789,{coords={{60.4,75.3,1453}},isBreadcrumb=1,lvl=47,nextQuests={3764},qgs={6740},r=2,rwp=40003}),q(10520,{awp=20001,c