dron, a giant excavation site forming a huge rift in the middle of the Searing Gorge. The Slag Pit lies within The Cauldron and is an underground mining site rich with multiple types of ore. The mining work is mainly done by slave labor, which consists for the most part of captured enemies.\n\nEver since the Dark Iron dwarves' capital, Thaurissan, was destroyed by the summoning of Ragnaros, they have searched for a landmass to control for their filthy, industrious works. The Searing Gorge was the obvious choice due to a low military presence, scarce population, few settlements, and high vulnerability. The dwarven garrisons were soon overrun by a massive Dark Iron invasion which forced them to retreat to Loch Modan and seal the passage.",g={n(-1000004,{ach(774,{description="Explore Searing Gorge, revealing the covered areas of the world map.",OnClick=handlers.EXPLORATION_OnClick,OnUpdate=handlers.EXPLORATION_OnUpdate})}),n(-1000019,{exp(1957),exp(1959),exp(1442),exp(247),exp(1958),exp(246),exp(1444)}),n(-1000021,{fp(74,{coords={{37.8,30.6,1427}},crs={2941},r=2}),fp(75,{coords={{34.8,30.6,1427}},crs={3305},r=1})}),n(-1000030,{prof(165,{n(7868,{coords={{63.6,75.8,1427}},r=2,rwp=40003,g={r(36074,{awp=20005,learnedAt=260,requireSkill=10658,rwp=40003,u=17}),r(36077,{awp=20005,learnedAt=330,requireSkill=10658,rwp=40003,u=17}),r(35590,{awp=20005,learnedAt=375,requireSkill=10658,rwp=40003,u=17}),r(35591,{awp=20005,learnedAt=375,requireSkill=10658,rwp=40003,u=17}),r(35589,{awp=20005,learnedAt=375,requireSkill=10658,rwp=40003,u=17}),r(10658,{learnedAt=225,requireSkill=10658,rwp=40003}),r(10630,{learnedAt=230,requireSkill=165,rwp=40003}),r(10632,{learnedAt=250,requireSkill=165,rwp=40003})}})})}),n(-1000031,{q(3201,{coords={{71.4,16.2,1455}},lvl=40,maps={1432},providers={{"i",10022}},qgs={8256},r=2,rwp=40003,sourceQuests={3182},g={i(5396,{b=1,rwp=40003})}}),q(4449,{coords={{65.5,62.2,1427}},cost={{"i",4306,15}},lvl=43,providers={{"o",173265}},rwp=40003,g={qo(1,{providers={{"n",5