nd Sorrow Hill. The Scarlet Crusade has a significant holding in and around Hearthglen to the north, and the Alliance has settled in the small Chillwind Camp to the south.\n\nLike their eastern counterparts, the Western Plaguelands were once fertile and beautiful but are now gray, blighted and noxious. Undead wander the land and haunt the abandoned towns and farmsteads. The largest Scourge city here is Andorhal, beneath which is an underground complex housing the undead's School of Necromancy. The Scarlet Crusade strikes against the Scourge from Hearthglen. The only place of any sanity in the Western Plaguelands is Uther's Tomb, a consecrated monument to the fallen hero Uther Lightbringer.",g={n(-1000004,{ach(770,{description="Explore Western Plaguelands, revealing the covered areas of the world map.",OnClick=handlers.EXPLORATION_OnClick,OnUpdate=handlers.EXPLORATION_OnUpdate})}),n(-1000019,{exp(200),exp(2297),exp(199),exp(201),exp(190),exp(192),exp(193),exp(197),exp(813),exp(198),exp(202),exp(2620)}),n(-1000021,{fp(66,{coords={{42.8,85,1422}},crs={12596},r=2})}),n(-1000031,{q(5066,{coords={{54.8,62.6,1453}},isBreadcrumb=1,lvl=50,nextQuests={5092},qgs={2198},r=2,rwp=40003}),q(5090,{coords={{31.6,67,1455}},isBreadcrumb=1,lvl=50,nextQuests={5092},qgs={10877},r=2,rwp=40003}),q(5091,{coords={{36.4,39.8,1457}},isBreadcrumb=1,lvl=50,nextQuests={5092},qgs={10878},r=2,rwp=40003}),q(10373,{awp=20001,coords={{55.4,47.2,1947}},isBreadcrumb=1,lvl=50,nextQuests={5092},qgs={20722},r=2,rwp=40003}),q(5093,{coords={{46.6,64.6,1454}},isBreadcrumb=1,lvl=50,nextQuests={5096},qgs={10880},r=1,rwp=40003}),q(5094,{coords={{64,44,1458}},isBreadcrumb=1,lvl=50,nextQuests={5096},qgs={10879},r=1,rwp=40003}),q(5095,{coords={{41.4,54.2,1456}},isBreadcrumb=1,lvl=50,nextQuests={5096},qgs={10881},r=1,rwp=40003}),q(10374,{awp=20001,coords={{59.3,64.7,1954}},isBreadcrumb=1,lvl=50,nextQuests={5096},qgs={20724},r=1,rwp=40003}),q(4971,{coords={{39.4,66.8,1422}},lvl=53,qgs={10667},rwp=40003,g={qo(1,{provi